import React from "react";
import { SocialIcon } from 'react-social-icons';
import "./style.css";
import resume from "../../utils/assets/resume.pdf"

function Footer() {
  return (
    <footer className="footer">
      <span>Daniel Talmont &copy;2020</span>
      <SocialIcon url="https://github.com/dantalmont" style={{ height: 25, width: 25, margin: '10px' }} />
      <SocialIcon url="https://www.linkedin.com/in/danieltalmont" style={{ height: 25, width: 25 }} />
      <SocialIcon url="https://www.facebook.com/Dantalmont" style={{ height: 25, width: 25 }} />
      <SocialIcon url={resume} label="My resume" style={{ height: 25, width: 25 }} />
    </footer>
  );
}

export default Footer;
